import React from "react";
import "./App.css";

import { motion } from "framer-motion";

import "bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  const variants = {
    visible: { opacity: 1 },
    hidden: { opacity: 0 },
  };
  return <motion.div initial="hidden" animate="visible" variants={variants} />;
}

export default App;
